    // NOTE TO SELF: MAKE PAINTING GEN NOT ABLE TO GEN PAINTINGS OF DIFFERENT SIZES NEAR EACH OTHER
    public static void GenerateHellcastle(int x, int y)
    {
        Vector2 castleBottomCenterL = new Vector2(x + 199, y + 150);
        Vector2 castleBottomCenterR = new Vector2(x + 200, y + 150);

        MakeBox(x, y, 400, 150, ModContent.TileType<Tiles.ImperviousBrick>(), (ushort)ModContent.WallType<Walls.ImperviousBrickWallUnsafe>());
        MakePath(x, y, -1);
        MakePath(x, y, 1);

        // make decorative pillars on top
        MakeBox(x, y - 6, 6, 6, ModContent.TileType<Tiles.ImperviousBrick>(), ushort.MaxValue);
        MakeBox(x + 394, y - 6, 6, 6, ModContent.TileType<Tiles.ImperviousBrick>(), ushort.MaxValue);
        for (int i = x; i <= x + 400; i++)
        {
            if (i > x + 10 && i <= x + 390)
            {
                if (i % 8 == 0)
                {
                    MakeBox(i, y - 3, 4, 3, ModContent.TileType<Tiles.ImperviousBrick>(), ushort.MaxValue);
                }
            }
        }

        // large room
        MakeTunnel((int)castleBottomCenterL.X - 25, (int)castleBottomCenterL.Y - 115, Vector2.Zero, Vector2.Zero, 50);
        MakeTunnel((int)castleBottomCenterR.X + 25, (int)castleBottomCenterR.Y - 115, Vector2.Zero, Vector2.Zero, 50);

        //large room backwall
        AddDecorativeWalls((int)castleBottomCenterL.X - 50, (int)castleBottomCenterL.Y - 140);

        // remove random floating tiles
        RefineStructure(x, y, 400, 150);
        // place the trapezoid shape and the library altar on top of it, at the bottom of the large room
        AddLibraryAltar((int)castleBottomCenterL.X, (int)castleBottomCenterL.Y - 85);
        // add platforms in various places
        AddPlatforms(x, y, 400, 150);
        AddPaintings(x, y, 400, 150);
        AddSpikes(x, y, 400, 150);
        AddChests(x, y, 400, 150);
        AddFurniture(x, y, 400, 150);
        AddPots(x, y, 400, 150);
        // unsmooth tiles such as the spikes and impervious bricks
        UnsmoothTiles(x, y, 400, 150);
        // place up to 3 devil's scythes on the shelves/platforms
        AddDevilsScythes(x, y, 400, 150);
        MakeEntranceArea(x + 200, y + 135);
        AddEntranceArea(x, y + 150);
    }

    public static bool HasEnoughRoomForPaintingType(int x, int y, int width, int height)
    {
        for (int i = x; i < x + width; i++)
        {
            for (int j = y; j < y + height; j++)
            {
                if (Main.tile[i, j].HasTile)
                {
                    return false;
                }
            }
        }
        return true;
    }
    /// <summary>
    /// Helper method to find if there is a tile in range.
    /// </summary>
    /// <param name="x">X coordinate in tiles.</param>
    /// <param name="y">Y coordinate in tiles.</param>
    /// <param name="radius">The radius from the coordinate in which to check.</param>
    /// <param name="tileType">The tile type of the tile.</param>
    /// <returns>True if not found, false if found.</returns>
    public static bool TileNotInRange(int x, int y, int radius, ushort tileType)
    {
        int xMin = x - radius;
        int xMax = x + radius;
        int yMin = y - radius;
        int yMax = y + radius;

        for (int i = xMin; i < xMax; i++)
        {
            for (int j = yMin; j < yMax; j++)
            {
                if (Main.tile[i, j].TileType == tileType)
                {
                    return false;
                }
            }
        }
        return true;
    }

    public static bool IsThereRoomForChandelier(int x, int y)
    {
        for (int i = x - 1; i < x + 2; i++)
        {
            for (int j = y; j < y + 3; j++)
            {
                if (Main.tile[i, j].HasTile)
                {
                    return false;
                }
            }
        }
        return true;
    }

    public static void AddPaintings(int x, int y, int height, int width)
    {
        int s1t = 0;
        int s2t = 0;
        int s3t = 0;
        int s4t = 0;
        for (int i = x; i < x + width; i++)
        {
            for (int j = y; j < y + height; j++)
            {
                if (WorldGen.genRand.NextBool(225))
                {
                    if (s1t > 2) s1t = 0;
                    if (s2t > 5) s2t = 0;
                    if (s3t > 3) s3t = 0;
                    if (s4t > 2) s4t = 0;
                    int paintingSize = WorldGen.genRand.Next(4);
                    int tileType;
                    if (paintingSize == 1) // 2x3
                    {
                        int pStyle = 0;
                        switch (s1t)
                        {
                            case 0:
                                pStyle = 1;
                                break;
                            case 1:
                                pStyle = 10;
                                break;
                            case 2:
                                pStyle = 4;
                                break;
                        }
                        s1t++;
                        if (HasEnoughRoomForPaintingType(i, j, 2, 3) && TileNotInRange(i, j, 7, TileID.Painting2X3))
                        {
                            WorldGen.PlaceTile(i, j, TileID.Painting2X3, style: pStyle);
                        }
                    }
                    if (paintingSize == 2) // 3x3
                    {
                        tileType = TileID.Painting3X3;
                        int pStyle = 0;
                        switch (s2t)
                        {
                            case 0:
                                pStyle = 65;
                                break;
                            case 1:
                                pStyle = 71;
                                break;
                            case 2:
                                pStyle = 31;
                                break;
                            case 3:
                                pStyle = 1;
                                tileType = ModContent.TileType<Tiles.Paintings3x3>();
                                break;
                            case 4:
                                pStyle = 16;
                                break;
                            case 5:
                                pStyle = 17;
                                break;
                        }
                        s2t++;
                        if (HasEnoughRoomForPaintingType(i, j, 3, 3) && (TileNotInRange(i, j, 8, TileID.Painting3X3) || TileNotInRange(i, j, 7, (ushort)ModContent.TileType<Tiles.Paintings3x3>())))
                        {
                            WorldGen.PlaceTile(i, j, tileType, style: pStyle);
                        }
                    }
                    if (paintingSize == 3) // 6x4
                    {
                        int pStyle = 0;
                        switch (s3t)
                        {
                            case 0:
                                pStyle = 1;
                                break;
                            case 1:
                                pStyle = 15;
                                break;
                            case 2:
                                pStyle = 16;
                                break;
                            case 3:
                                pStyle = 18;
                                break;
                        }
                        s3t++;
                        if (HasEnoughRoomForPaintingType(i, j, 6, 4) && TileNotInRange(i, j, 10, (ushort)ModContent.TileType<Tiles.Paintings>()))
                        {
                            WorldGen.PlaceTile(i, j, ModContent.TileType<Tiles.Paintings>(), style: pStyle);
                        }
                    }
                    if (paintingSize == 4) // 3x2
                    {
                        int pStyle = 0;
                        tileType = TileID.Painting3X2;
                        switch (s4t)
                        {
                            case 0:
                                pStyle = 0;
                                break;
                            case 1:
                                pStyle = 17;
                                break;
                            case 2:
                                pStyle = 0;
                                tileType = ModContent.TileType<Tiles.Paintings3x2>();
                                break;
                        }
                        s4t++;
                        if (HasEnoughRoomForPaintingType(i, j, 3, 2) && (TileNotInRange(i, j, 7, TileID.Painting3X2) || TileNotInRange(i, j, 7, (ushort)ModContent.TileType<Tiles.Paintings3x2>())))
                        {
                            WorldGen.PlaceTile(i, j, tileType, style: pStyle);
                        }
                    }
                }
            }
        }
    }
