                                break;
                            case 5:
                                if (WorldGen.genRand.NextBool(4))
                                {
                                    int randomPainting = WorldGen.genRand.Next(4);
                                    if (randomPainting == 0)
                                    {
                                        randomPainting = 13;
                                    }
                                    else if (randomPainting == 1)
                                    {
