    public static void AddPillarsInHell(int x, int y)
    {
        int numPillars = WorldGen.genRand.Next(10, 17);
        List<int> pillarLocs = new();
        int modifier = 0;
        for (int i = 0; i < numPillars; i++)
        {
            pillarLocs.Add(WorldGen.genRand.Next(x + modifier, x + modifier + 10));
            modifier += WorldGen.genRand.Next(45, 52);
        }

        for (int locsX = 0; locsX < pillarLocs.Count; locsX++)
        {
            int pillarWidth = WorldGen.genRand.Next(20, 36);
            int pillarHeight = WorldGen.genRand.Next(90, 115);
            if (pillarLocs[locsX] + pillarWidth >= x + 400)
            {
                continue;
            }
            MakeBox(pillarLocs[locsX], Main.maxTilesY - pillarHeight - 10, pillarWidth, pillarHeight, ModContent.TileType<Tiles.ImperviousBrick>(), ushort.MaxValue);
            for (int i = pillarLocs[locsX] + 1; i < pillarLocs[locsX] + pillarWidth; i++)
            {
                for (int j = y + 150; j < Main.maxTilesY - pillarHeight - 10; j++)
                {
                    Main.tile[i, j].WallType = (ushort)ModContent.WallType<Walls.ImperviousBrickWall>();
                }
            }
            //MakeBox(pillarLocs[locsX] + 1, y + 150, pillarWidth - 1, (Main.maxTilesY - pillarHeight - 10) - (y + 150), ushort.MaxValue, (ushort)ModContent.WallType<Walls.ImperviousBrickWallUnsafe>());
        }
    }
    public static void AddLibraryAltar(int x, int y)
    {
        int pyramidStep = 3;
        for (int pyramidY = y - 4; pyramidY <= y + 1; pyramidY++)
        {
            for (int pyramidX = x - pyramidStep + 1; pyramidX <= x + pyramidStep + 1; pyramidX++)
            {
                WorldGen.PlaceTile(pyramidX + 1, pyramidY, ModContent.TileType<Tiles.ImperviousBrick>());
            }
            pyramidStep++;
        }
        WorldGen.PlaceTile(x + 2, y - 5, ModContent.TileType<Tiles.LibraryAltar>());
    }
    public static void AddDevilsScythes(int x, int y, int width, int height)
    {
        int booksPlaced = 0;
        while (booksPlaced < 3)
        {
            for (int i = x; i < x + width; i++)
            {
                for (int j = y; j < y + height; j++)
                {
                    Tile t = Main.tile[i, j];
                    if (t.TileType == TileID.Books && WorldGen.genRand.NextBool(50))
                    {
                        WorldGen.KillTile(i, j);
                        WorldGen.PlaceTile(i, j, ModContent.TileType<Tiles.DevilsScythe>());
                        booksPlaced++;
                    }
                }
                if (booksPlaced > 2) return;
            }
        }
    }
    public static void UnsmoothTiles(int x, int y, int width, int height)
    {
        for (int i = x; i < x + width; i++)
        {
            for (int j = y; j < y + height; j++)
            {
                Tile t = Main.tile[i, j];
                if (t.TileType == ModContent.TileType<Tiles.VenomSpike>() ||
                    t.TileType == ModContent.TileType<Tiles.ImperviousBrick>())
                {
                    t.Slope = SlopeType.Solid;
                }
            }
        }
    }
    public static void MakeEntranceArea(int x, int y)
    {
        MakeBox(x - 10, y + 13, 20, 25, ModContent.TileType<Tiles.ImperviousBrick>(), (ushort)ModContent.WallType<Walls.ImperviousBrickWallUnsafe>());
        MakeBox(x - 7, y, 14, 40, ushort.MaxValue, (ushort)ModContent.WallType<Walls.ImperviousBrickWallUnsafe>());
        MakeBox(x - 7, y + 34, 14, 4, ModContent.TileType<Tiles.UltraResistantWood>(), (ushort)ModContent.WallType<Walls.ImperviousBrickWallUnsafe>());
    }
    public static void MakePath(int x, int y, int start)
    {
        Vector2 lastPos;
        Vector2 newPos = Vector2.Zero;

        Vector2 castleBottomCenterL = new Vector2(x + 199, y + 150);
        Vector2 castleBottomCenterR = new Vector2(x + 200, y + 150);

        int randDir = start;
        int randHeight = start;
        int lastPath;
        int givePurpose = 0;

        for (int i = 0; i < 60; i++)
        {
            lastPath = givePurpose;
            givePurpose = WorldGen.genRand.Next(2);
            int randStairHeight = WorldGen.genRand.Next(12, 20);
            randStairHeight = 15;
            int randHallwayLength = 30;

            if (givePurpose == 0 && lastPath == 0)
            {
                givePurpose = 1;
            }

            lastPos = newPos;
            switch (givePurpose)
            {
                case 0:
                    if (lastPos.X - randStairHeight < -200 + randStairHeight && randDir == -1)
                    {
                        randDir = 1;
                    }
                    if (lastPos.X + randStairHeight > 200 - randStairHeight && randDir == 1)
                    {
                        randDir = -1;
                    }
                    if(lastPos.Y + randStairHeight > 0 - randStairHeight && randHeight == 1)
                    {
                        randHeight = -1;
                    }
                    if(lastPos.Y - randStairHeight < -140 + randStairHeight && randHeight == -1)
                    {
                        randHeight = 1;
                    }
                    newPos += new Vector2(randStairHeight * randDir, randStairHeight * randHeight);
                    break;
                case 1:
                    if (lastPos.X - randHallwayLength < -200 + randHallwayLength && randDir == -1)
                    {
                        randDir = 1;
                    }
                    if (lastPos.X + randHallwayLength > 200 - randHallwayLength && randDir == 1)
                    {
                        randDir = -1;
                    }
                    newPos += new Vector2(randHallwayLength * randDir, 0);
                    break;
            }
            MakeTunnel((int)castleBottomCenterL.X, (int)castleBottomCenterL.Y - 15, lastPos, newPos, WorldGen.genRand.Next(6, 9));
        }
    }
    public static void MakeBox(float x, float y, int width, int height, int type, ushort walltype)
    {
        for (int i = 0; i < width; i++)
        {
            for (int j = 0; j < height; j++)
            {
                Tile t = Main.tile[(int)x + i, (int)y + j];
                if (type == ushort.MaxValue)
                {
                    t.TileType = 0;
                    t.LiquidAmount = 0;
                    t.HasTile = false;
                }
                else
                {
                    t.TileType = (ushort)type;
                    t.HasTile = true;
                    t.LiquidAmount = 0;
                    t.LiquidType = LiquidID.Water;
                    t.IsHalfBlock = false;
                    t.Slope = SlopeType.Solid;
                    if (i == 0 || i == width - 1 || j == 0 || j == height - 1)
                    {

                    }
                    else
                    {
                        WorldGen.KillWall((int)x + i, (int)y + j);
                        if (walltype != ushort.MaxValue) WorldGen.PlaceWall((int)x + i, (int)y + j, walltype, true);
                    }
                }
            }
        }
    }
    /// <summary>
    /// Destroys a box of tiles.
    /// </summary>
    public static void DestroyBox(int x, int y, int width, int height)
    {
        int a = -(width / 2);
        int b = -(height / 2);
        for (int i = a; i <= width / 2; i++)
        {
            for (int j = b; j <= height / 2; j++)
            {
                WorldGen.KillTile(x + i, y + j, noItem: true);
            }
        }
    }
    public static void MakeBoxFromCenter(int x, int y, int width, int height, int type)
    {
        int a = -(width / 2);
        int b = -(height / 2);
        for (int i = a; i <= width / 2; i++)
        {
            for (int j = b; j <= height / 2; j++)
            {
                WorldGen.PlaceTile(x + i, y + j + 1, type);
            }
        }
    }
